Our recovery package – #NextGenerationEU, is also the recovery plan for farmers.

We will deploy all effort to push for a sustainable agriculture that allows them to earn a fair living by producing healthy products.

@vonderleyen speech at #AgriOutlook: https://t.co/qYwolK2iUh https://t.co/VdJbg6VUpc

"We have the 7-year EU budget;
we have #NextGenerationEU;
we have our climate target for 2030.
What a hat-trick!"

